INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(1, 'Nevelőszülők bérének emelése - Raising the wages of foster parents', 'LMP: azonnal emeljék a nevelőszülők bérét!', 'belföld', 'Azonnal emelni kell a nevelőszülők bérét és inflációkövetővé kell tenni a gyermekek után járó ellátmányt is, hogy finanszírozható legyen a gyermekek minden alapvető szükséglete - közölte az LMP népjóléti és családügyi szakszóvivője január 14-én, vasárnap Pécsen.', 'The wages of foster parents must be increased immediately and the allowance for children must be adjusted for inflation so that all the basic needs of children can be announced in January, said the spokesperson for the welfare and family affairs of the LMP on Sunday the 14th in Pécs.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(2, 'Nagy Feró szülinapja - Fero Nagy\'s birthday', 'Nagy titkot árult el születésnapjáról Nagy Feró!', 'belföld', 'Vasárnap töltötte 78. születésnapját Nagy Feró. A Borsnak elárulta: kitűnő egészségnek örvend, a család és a baráti társaság egy nagyobb bulit akart szervezni neki, de úgy döntött, majd inkább a 80. születésnapjánál kerít sort erre az ünneplésre.', 'Feró Nagy celebrated his 78th birthday on Sunday. He told Bors: he is in excellent health, his family and friends wanted to organize a bigger party for him, but he decided to celebrate his 80th birthday instead.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(3, 'Szlovák-Magyar határ - Slovak-Hungarian border', 'Óriási változás jöhet a szlovák-magyar határnál', 'belföld', 'Küszöbön áll a szlovák miniszterelnök budapesti hivatalos látogatása, ahol az egyik fő napirendi pont az lesz, hogy a határ menti közlekedés újragondolásával hogyan lehetne segíteni a határ két oldalán élőket.', 'The Slovak Prime Minister\'s official visit to Budapest is approaching, where one of the main items on the agenda will be how to help people living on both sides of the border by rethinking border traffic.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(4, 'Rendőrség - Police', 'Erre készül most a rendőrség', 'belföld', 'Állásbörzét tart az Országos Rendőr-főkapitányság (ORFK) szerdán Budapesten, ahol bemutatják a rendőrségen betölthető civil és hivatásos munkakörök széles spektrumát - közölte az ORFK.', 'The National Police Headquarters (ORFK) will hold a job fair on Wednesday in Budapest, where the wide range of civilian and professional positions that can be filled in the police will be presented, the ORFK announced.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(5, 'Napelempénz - Solar panel money', 'Hétfőn 10 órától indulhat a roham az ötmilliós állami napelempénzért', 'belföld', 'Ha valaki biztosra akar menni az állami napelemes pályázat akár ötmillió forintos támogatásának megszerzésében, akkor sietnie kell hétfőn. Január 15-én 10 órától indul ugyanis a jelentkezők online előregisztrációja, és a kiírás szerint a pénzt érkezési sorrendben kaphatja meg majd maximum 15 160 pályázó, derül ki a Bank360 összeállításából.', 'If someone wants to be sure of obtaining a subsidy of up to five million forints for the state solar tender, then they must hurry on Monday. The online pre-registration of applicants will start at 10 a.m. on January 15, and according to the announcement, a maximum of 15,160 applicants will be able to receive the money on a first-come, first-served basis, according to Bank360\'s compilation.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(6, 'Amerika hidegrekord - America\'s cold record', 'Hidegrekord az Egyesült Államokban', 'külföld', 'Az Egyesült Államokban rendkívüli hideg tombol, a meteorológusok rekordokat megdöntő időt várnak hétfőre; olyan hideget, amilyet az ország modern történetében még soha nem tapasztaltak. Lesznek helyek, ahol a hőmérő akár mínusz 45 Celsius-fokot is mutathat. A sarkvidéki hideg nemcsak az embereket, hanem a politikai eseményeket is befolyásolja, hiszen több politikus is a kampányrendezvényei lemondására kényszerült, írta meg a Hír TV.', 'Extreme cold is raging in the United States, meteorologists expect record-breaking weather for Monday; a cold that has never been experienced in the country\'s modern history. There will be places where the thermometer can show minus 45 degrees Celsius. The Arctic cold affects not only people, but also political events, as several politicians were forced to cancel their campaign events, Hír TV wrote.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(7, 'Taylor Swift titkosügynök - Taylor Swift is a secret agent', 'Taylor Swift titkos ügynök? A Pentagon is megszólalt a vádakról', 'külföld', 'Megdöbbentő váddal állt elő a Fox News műsorvezetője, aki azt állította, hogy Taylor Swift a Pentagon titkos ügynöke. Az amerikai védelmi minisztérium most cáfolta, hogy ők alkalmaznák az énekesnőt.', 'A shocking accusation came from the host of Fox News, who claimed that Taylor Swift is a secret agent of the Pentagon. The US Department of Defense has now denied that they would employ the singer.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(8, 'Kína és Egyiptom - China and Egypt', 'Kína és Egyiptom is a gázai harcok leállítását és palesztin állam megalakítását sürgetti', 'külföld', 'A gázai harcok leállítását és palesztin állam megalakítását sürgette az egyiptomi és a kínai külügyminiszter Kairóban. A két ország közös közleményben egyúttal szót emeltek a Vörös-tenger hajózási szabadságáért és a térség biztonságáért is.', 'The Egyptian and Chinese foreign ministers urged an end to the fighting in Gaza and the establishment of a Palestinian state in Cairo. In a joint statement, the two countries also spoke out for the freedom of navigation in the Red Sea and the security of the region.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(9, 'Oroszország és Németország - Russia and Germany', 'Oroszország megelőzi Németországot', 'külföld', 'Oroszországé az ötödik legnagyobb gazdaság a világon. Oroszország megelőzi Németországot, és a világ 5. legnagyobb gazdasága, Európában pedig a legnagyobb.', 'Russia has the fifth largest economy in the world. Russia is ahead of Germany and has the 5th largest economy in the world and the largest in Europe.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(10, 'Coca-Cola', 'Tőlük szokatlan, forradalmi reklámmal üzent a Coca-Cola', 'külföld', 'Olyan jön, ami még nem volt: ismerje meg Ön is a cég nagy „családját”, és lehetőleg vásároljon is belőlük! Legalábbis valami ilyesmit akar üzenni a tévénézőknek a Coca-Cola.', 'Something that hasn\'t happened before is coming: get to know the company\'s big \"family\" yourself and, if possible, buy from them! At least that\'s what Coca-Cola wants to tell TV viewers.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(11, 'Microsoft', 'Megint erőszakoskodna a Microsoft', 'IT', 'A Windows elindulásakor azonnal a számítógépezők arcába nyitná a Copilot chatbotot. Tovább feszíti a húrt az évek óta egyre agresszívebben erőszakoskodó Microsoft, a Windows 11 legújabb nyilvános előzetesében egyes felhasználóknál már a bejelentkezést követően azonnal megnyitja a Copilot chatbot felületét.', 'When Windows starts up, it would immediately open the Copilot chatbot in the faces of computer users. Microsoft, which has become more and more aggressive over the years, is pulling the strings further. In the latest public preview of Windows 11, some users open the Copilot chatbot interface immediately after logging in.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(12, 'Samsung Galaxy Xcover 7', 'Kedvező áron jön a Galaxy XCover7 strapamobil', 'IT', 'Terepen dolgozóknak és a telefonjukkal mostohán bánóknak jöhet kapóra. Bemutatta a legújabb strapabíró okostelefonját a CES alatt a Samsung. A gyárilag megerősített vázú Galaxy XCover7 modellt elsősorban terepen dolgozó üzleti ügyfeleknek ajánlja, azonban január során a fogyasztói piacon is elérhetővé válik, az ajánlott fogyasztói ára 149 990 forint.', 'It can be used by those working in the field and those who handle their phones with care. Samsung presented its latest durable smartphone during CES. The Galaxy XCover7 model with a factory-reinforced frame is primarily recommended for business customers working in the field, but it will also be available on the consumer market in January, with a recommended consumer price of HUF 149,990.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(13, 'Aroma Shooter', 'Ez a kütyü megszagolhatóvá tenné a filmeket', 'IT', 'Egyszerre hat illatpatron tehető be a nyakba akasztható Aroma Shooterbe. Nem a táskának tűnő mikrosütő volt az egyetlen feltűnően japán találmány a Cosumer Electronics Show-n, az AromaJoin startup demonstrálta az Aroma Shooter Wearable 3 kiegészítőjét is. A nyakba tehető eszközzel a vállalat megszagolhatóvá tenné a filmeket és a játékokat, a látást és a hallást követően harmadik érzékszerven keresztül tenné átélhetővé azokat.', 'Six aroma cartridges can be inserted into the Aroma Shooter that can be hung around the neck at the same time. The micro-oven that looks like a bag was not the only strikingly Japanese invention at the Cosumer Electronics Show, the startup AromaJoin also demonstrated the Aroma Shooter Wearable 3 accessory. With the device around the neck, the company would make movies and games smellable, experience them through a third sense after sight and hearing.', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(14, 'Apple lokátor - Apple locator', 'Kétszer annyi kütyü követhető az Apple Lokátorral', 'IT', 'Eddig tizenhat eszközre volt limitálva, egyes holmik duplán vagy triplán számítanak. Csendben érdemi frissítést kapott az eltűnt eszközök megkeresésére kitalált Apple Find My (Lokátor) szolgáltatás, a gyártó dokumentációja szerint a felhasználók a korábbi kategóriánként (személyek, eszközök, tárgyak) tizenhat helyett immáron harminckét megkereshető eszközt is képesek hozzápárosítani a felhasználói fiókjaikhoz.', 'Until now, it was limited to sixteen devices, some things count double or triple. The Apple Find My (Locator) service invented for locating missing devices has quietly received a significant update, according to the manufacturer\'s documentation, users can now match thirty-two searchable devices to their user accounts instead of sixteen per category (persons, devices, objects).', );
INSERT INTO `news` (`news_id`, `news_title`, `news_brief`, `news_category`, `news_full_hu`, `news_full_en`, `news_pict`) VALUES
(15, 'Tech ipar - Tech industry', 'Újabb leépítési hullám indult a techiparban', 'IT', 'Csak ezen a héten több ezren veszítették el a munkájukat. Megismétlődni látszik a tavaly év eleji leépítési hullám a techiparban, a CES leple alatt számos közismert cég jelentett be tömeges elbocsátásokat. A Twitch és a Unity együttesen olyan 2300 főnek mondtak fel, azóta pedig a Google, a Discord, továbbá az Audible is csatlakozott hozzájuk.', 'Thousands have lost their jobs this week alone. The downsizing wave in the tech industry at the beginning of last year seems to be repeating itself, many well-known companies announced mass layoffs under the guise of CES. Twitch and Unity together laid off about 2,300 people, and since then Google, Discord, and Audible have also joined them.', );

